import React, { useState } from 'react'; 
import { BrowserRouter as Router, Routes, Route, useNavigate } from 'react-router-dom';
// import { QRCodeSVG } from 'qrcode.react'; // Keep if you plan to add QR codes back later
import QrScanner from 'react-qr-scanner';
import './App.css';

// --- Static Ticket Data ---
// This array now holds the information for each ticket card.
const ticketsDataArray = [
  {
    number: 1,
    header: 'panel 1',
    id: 'TC-2025-0420',
    date: 'may 1, 2025',
    place: 'lecture hall',
    time: '9:00 AM - 5:00 PM',
    qrValue: 'TC-2025-0420-TICKET-001' // Example unique value for QR code
  },
  {
    number: 2,
    header: 'panel 2',
    id: 'MF-2025-0715',
    date: 'July 15-17, 2025',
    place: 'great hall',
    time: 'Starts 12:00 PM Daily',
    qrValue: 'MF-2025-0715-TICKET-002'
  },
  {
    number: 3,
    header: 'panel 3',
    id: 'AE-2025-0901',
    date: 'September 1, 2025',
    place: 'hall A',
    time: '7:00 PM - 11:00 PM',
    qrValue: 'AE-2025-0901-TICKET-003'
  },
   {
     number: 4,
    header: 'panel 4',
     id: 'AE-2025-1010',
    date: 'October 10, 2025',
    place: 'Hall A',
    time: '2:00 PM - 4:00 PM',
    qrValue: 'AE-2025-1010-TICKET-004'
   }
];

// --- Scanner Page Component (Updated) ---
function ScannerPage() {
  const navigate = useNavigate();
  const [scanResult, setScanResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [registrationData, setRegistrationData] = useState(null);
  const [processingStatus, setProcessingStatus] = useState('');

  const handleScan = async (data) => {
    if (data) {
      try {
        setLoading(true);
        setProcessingStatus('Processing QR code...');

        const scannedUrl = data.text;
        console.log('Scanned URL:', scannedUrl);

        // Parse URL to extract parameters
        let urlObj;
        try {
          urlObj = new URL(scannedUrl);
        } catch (err) {
          throw new Error('Invalid QR code URL format');
        }

        // Extract eid and pid from URL parameters
        const eid = urlObj.searchParams.get('eid');
        const pid = urlObj.searchParams.get('pid');

        if (!eid || !pid) {
          throw new Error('QR code URL is missing required parameters (eid or pid)');
        }

        const WORDPRESS_API_URL = process.env.REACT_APP_WORDPRESS_API_URL;
        if (!WORDPRESS_API_URL) {
          throw new Error('WordPress API URL not configured');
        }

        const response = await fetch(`${WORDPRESS_API_URL}/process`, {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
            'Accept': 'application/json'
          },
          body: JSON.stringify({ 
            eid, 
            pid,
            scanned_at: new Date().toISOString()
          }),
        });

        const result = await response.json();

        if (!response.ok) {
          throw new Error(result.message || `API Error: ${response.status}`);
        }

        if (result.data && result.data.registration_data) {
          setRegistrationData(result.data.registration_data);
          setProcessingStatus('Registration data processed successfully');
        } else {
          throw new Error('No registration data found in response');
        }
      } catch (err) {
        console.error('Error processing scan:', err);
        setError(err.message);
        setProcessingStatus('Error during scan processing');
      } finally {
        setLoading(false);
      }
    }
  };

  const handleError = (err) => {
    console.error('QR Scanner error:', err); // Debug log
    setError('Error accessing camera');
    setProcessingStatus('Camera error occurred');
  };

  return (
    <div className="scanner-container">
      <h2>Scan Registration QR Code</h2>
      <div className="scanner-wrapper">
        <QrScanner
          delay={300}
          onError={handleError}
          onScan={handleScan}
          constraints={{
            video: {
              facingMode: "environment",
              width: { ideal: 640 },
              height: { ideal: 480 },
              willReadFrequently: true
            }
          }}
          style={{ width: '100%', maxWidth: '500px' }}
        />
      </div>

      {loading && (
        <div className="status-message">
          <p>{processingStatus}</p>
        </div>
      )}

      {error && (
        <div className="error-message">
          <p>Error: {error}</p>
        </div>
      )}

      {registrationData && (
        <div className="result-container">
          <h3>Registration Data:</h3>
          <div className="registration-details">
            <p><strong>Name:</strong> {registrationData.Name}</p>
            <p><strong>Institution:</strong> {registrationData.Institution}</p>
            <p><strong>Title:</strong> {registrationData.Title}</p>
            <p><strong>Email:</strong> {registrationData.Email}</p>
            <p><strong>Phone:</strong> {registrationData.Phone}</p>
            <p><strong>Nationality:</strong> {registrationData.Nationality}</p>
            <p><strong>Preferred Contact:</strong> {registrationData.Preferred_Contact}</p>
          </div>
        </div>
      )}
    </div>
  );
}

// --- Main App Component (Refactored) ---
function TicketList() {
  const navigate = useNavigate();

  return (
    <div className="App">
      <h1>CAICC Registration App</h1>
      <div className="tickets-container">
        {ticketsDataArray.map((ticket) => (
          <div key={ticket.number} className="ticket">
            <div className="ticket-number">{ticket.number}</div>
            <div className="ticket-content">
              <h2>{ticket.header}</h2>
              <p className="event-id">Event #{ticket.id}</p>
              <div className="event-details">
                <span>{ticket.date}</span> |
                <span>{ticket.place}</span> |
                <span>{ticket.time}</span>
              </div>
              <div className="divider"></div>
              <div className="scan-button-container">
                <button 
                  onClick={() => navigate('/scan')} 
                  className="scan-button"
                >
                  Scan QR Code
                </button>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<TicketList />} />
        <Route path="/scan" element={<ScannerPage />} />
      </Routes>
    </Router>
  );
}

export default App;
